void input()
{
    unsigned char byte1 = 0, byte2 = 0, byte3 = 0;
    int previousKey = byte2;
    int PS2_data, RVALID;

    // Handle key input via polling.

    PS2_data = *(pPS2);           // read the Data register in the PS/2 port
    RVALID = (PS2_data & 0x8000); // extract the RVALID field

    if (RVALID != 0)
    {
        byte3 = PS2_data & 0xFF;
    }

    if (byte3 == BREAK)
    {
        acceptInput = TRUE; // Wait for a break before accepting input.
    }
    else if (byte3 == LEFT_KEY && acceptInput)
    {
        acceptInput = FALSE;
       

        
if  (gameState == GAME_START){
        dirX = -1;
        dirY = 0;
}
    }
    else if (byte3 == RIGHT_KEY && acceptInput)
    {
        acceptInput = FALSE;
       

        // printf("RIGHT KEY\n");

        dirX = 1;
        dirY = 0;
    }
    else if (byte3 == UP_KEY && acceptInput)
    {
         acceptInput = FALSE;
        if (gameState ==MAIN_MENU){
            if (menu_selection == 0)
            {
                menu_selection = 2;
            }
            else
            {
                menu_selection = (menu_selection - 1) % 3;
            }
           
        }
       
        

        // printf("UP KEY\n");
        if (gameState == GAME_START)
        {
            dirX = 0;
            dirY = -1;
        }
       
    }
    else if (byte3 == DOWN_KEY && acceptInput)
    {
          acceptInput = FALSE;
       
       
        if (gameState ==MAIN_MENU){
            menu_selection = (menu_selection + 1) % 3;
        }
      

        
        if (gameState == GAME_START){
            dirX = 0;
            dirY = 1;
        }

    
    }
    else if (byte3 == ENTER_KEY && acceptInput)
    {
        acceptInput = FALSE;
        clear_screen();
        if (gameState == START_SCREEN){
            gameState = MAIN_MENU;
        }
        if (gameState == MAIN_MENU)
        {
            if (menu_selection == 0)
            {
                gameState = GAME_START;
            }
            else if (menu_selection == 1)
            {
                gameState = SETTINGS_PAGE;
            }
            else if (menu_selection == 2)
            {
                gameState = ACHIEVEMENTS_PAGE;
            }
        }
        else if (gameState == GAME_OVER)
        {
            gameState = MAIN_MENU;
        }
        else if (gameState == GAME_PAUSE){
            gameState = GAME_START;
        }
        else if (gameState == SETTINGS_PAGE )
        {
           soundEnabled = !soundEnabled;
        }
        
        
}
else if (byte3 == ESC_KEY && acceptInput)
    {
        acceptInput = FALSE;
        clear_screen();
        if (gameState == SETTINGS_PAGE || gameState == ACHIEVEMENTS_PAGE || gameState == GAME_OVER)
        {
            gameState = MAIN_MENU;
        }
        else if (gameState == GAME_PAUSE){
            gameState = MAIN_MENU;
        }
        if (gameState == GAME_START){
            gameState = GAME_PAUSE;
        }
        
    }
}

int generateShadowGradient(int colorCode) {
    // Extract RGB components from the color code
    int r = ((colorCode >> 8) & 0xF) * 0x11;
    int g = ((colorCode >> 4) & 0xF) * 0x11;
    int b = (colorCode & 0xF) * 0x11;

    // Reduce each RGB component by a certain amount to darken the color
    int shadowR = r * 0.8;  // For example, reducing red component by 20%
    int shadowG = g * 0.8;  // For example, reducing green component by 20%
    int shadowB = b * 0.8;  // For example, reducing blue component by 20%

    // Ensure shadow color components are within valid range [0, 255]
    shadowR = (shadowR < 0) ? 0 : ((shadowR > 255) ? 255 : shadowR);
    shadowG = (shadowG < 0) ? 0 : ((shadowG > 255) ? 255 : shadowG);
    shadowB = (shadowB < 0) ? 0 : ((shadowB > 255) ? 255 : shadowB);

    // Calculate the shadow color (fully opaque)
    int shadowColor = (shadowR << 16) | (shadowG << 8) | shadowB;

    return shadowColor;
}


int darken_hex_color(int color, double factor) {
    // Extract red, green, and blue color channels
    int r = (color >> 8) & 0xF;
    int g = (color >> 4) & 0xF;
    int b = color & 0xF;

    // Darken each color channel
    r = (int)(r * factor);
    g = (int)(g * factor);
    b = (int)(b * factor);

    // Ensure values are in the range [0, 255]
    r = (r < 0) ? 0 : (r > 255) ? 255 : r;
    g = (g < 0) ? 0 : (g > 255) ? 255 : g;
    b = (b < 0) ? 0 : (b > 255) ? 255 : b;

    // Pack RGB values into an integer
    int darkened_color = (r << 16) | (g << 8) | b;

    return darkened_color;
}

void delay(int duration)
{
    while (duration > 0)
    {
        duration--;
    }
}

float random_float(float min, float max) {

    double val =  min + (((float)rand()) / RAND_MAX) * (max - min);
    if (val > -1 && val <1) {
        random_float(min, max);
    }
    return val;
}

void wait_for_vsync()
{
    *pixel_ctrl_ptr = 1;
    int status = *(pixel_ctrl_ptr + 3);

    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void clear_screen()
{
    volatile short int *one_pixel_address;

    for (int y = 0; y < HEIGHT; ++y)
    {
        for (int x = 0; x < WIDTH; ++x)
        {
            one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1); // Do not cast.
            *one_pixel_address = 0;
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = line_color;
}

void plot_pixel_delay(int x, int y, short int line_color, int delay)
{
    short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = line_color;
    int duration = delay;
    while (duration > 0)
    {
        duration--;
    }
}

