int main(void)
{
    
   
    for (int i = 0; i < NUM_PARTICLES; ++i) {
        particles[i].x = (int)(random_float(20, WIDTH-20));
        particles[i].y = (int)(random_float(20, HEIGHT-20));
        particles[i].velocity_x = random_float(-5,5); // Random velocity between -2 and 2
        particles[i].velocity_y = random_float(-5,5); // Random velocity between -2 and 2
        particles[i].color = rand() % 65536;      // Random color (16-bit)
        particles[i].size = (rand() % 2 == 0) ? 3 : 5;            
    }
    // Wait for v-sync before writing to pixel buffer.
    animationRadius = sqrt((240 * 240) + (240 * 240)) ;
    frame ++;
    wait_for_vsync();

    pixel_buffer_start = *pixel_ctrl_ptr;

    // Clear screen.
    clear_screen();

    // Generate random seed.
    srand(2444);
	
    // Draw game border
    //borderBuilder(TOP_LEFT_X, TOP_LEFT_Y, GAME_WIDTH, RED, 0);
	
    // Plot food item.
    int randX = rand() % (RANDOM_RANGE + 1);
    int randY = 0;
   // drawFruit(randX, randY, SCALE, fruits[fruitIdx], offsetEven);

    // Start with 1 block snake by default
    // (adjust STARTING_LENGTH for debugging).
    snakeLength = STARTING_LENGTH;
    for (int i = 0; i < snakeLength; ++i)
    {
        snake[i].colour = fruit_color[fruitIdx];
    }

    // Game loop.
    while (TRUE)
    {
        // Poll for input.
        input();
        if(gameState == START_SCREEN){
         	drawParticles();
			drawStartScreen();
          
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
           clearParticles();

        }
        else  if (gameState == MAIN_MENU){
            drawParticles();
			drawMainMenu();
      
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
            clearMainMenu();
            bobOffsetX =  !bobOffsetX;
            clearParticles();
        }
        //achievements page
        else if (gameState == ACHIEVEMENTS_PAGE){
            drawParticles();
            drawAcheivementsPage();
         
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
            clearAcheivementsPage();
            bobOffsetX =  !bobOffsetX;
            clearParticles();
        }
        // setting page
        else if (gameState == SETTINGS_PAGE){
            drawParticles();
            drawSettingPage();
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
            clearSettingPage();
            bobOffsetX =  !bobOffsetX;
            clearParticles();
        }
        else if (gameState == GAME_OVER){
            drawParticles();
            drawGameOver();
            
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
            clearGameOver();
             bobOffsetX =  !bobOffsetX;
            clearParticles();
        }
        else if (gameState == GAME_PAUSE){
            drawParticles();
        
            drawGamePause();
            int duration = DELAY/3;
            while (duration > 0)
            {
                duration--;
            }
            clearGamePause();
            
            clearParticles();
        }
       

        else if (gameState == GAME_START){

            printf("X: %d   Y: %d \n", headX, headY);

            // Boundary checks.
            if (headX + dirX < 0 || headX + dirX > GAME_WIDTH)
            {
                dirX = 0;
            }
            if (headY + dirY < 0 || headY + dirY > GAME_HEIGHT)
            {
                dirY = 0;
            }

            // Move head
            headX += dirX;
            headY += dirY;
            snake[0].x = headX;
            snake[0].y = headY;
            snake[0].dirX = dirX;
            snake[0].dirY = dirY;

            // Check for body intersection.
            // Avoid snake from collapsing into itself.

            // Should i = 2?
            //   for (int i = 2; i < snakeLength; i++)
            // {

            //   if (snake[i].x == snake[0].x && snake[i].y == snake[0].y)
            // {
            //   while(true)
            // {
            // printf("%d(%d, %d) %d(%d, %d)", i, snake[i].x, snake[i].y);
            //}
            //}
            //}

            // Update positions of the rest of snake body.
            if (dirX != 0 || dirY != 0)
            {
                for (int i = snakeLength - 1; i > 0; --i)
                {
                    snake[i].x = snake[i - 1].x;
                    snake[i].y = snake[i - 1].y;
                    snake[i].dirX = snake[i - 1].dirX;
                    snake[i].dirY = snake[i - 1].dirY;
                }
            }
            drawFruit(randX, randY, SCALE, fruits[fruitIdx],offsetEven);
            // Draw snake
            // for (int i = 0; i < snakeLength; i++){ boxBuilder(snake[i].x, snake[i].y, SCALE, WHITE); }
            for (int i = 0; i < snakeLength; i++)
            {
                if (i == 0 || i == 1)
                {
                    drawSnake(headX, headY, SCALE, snake_head_red, snake[i].dirX, snake[i].dirY, 0 , snake[i].colour);
                }
                else if (i%2 ==0){
                    drawSnake(snake[i].x, snake[i].y, SCALE, snake_body_red, snake[i].dirX, snake[i].dirY, offsetEven , snake[i].colour);
                }
                else{
                    drawSnake(snake[i].x, snake[i].y, SCALE, snake_body_red, snake[i].dirX, snake[i].dirY, offsetOdd, snake[i].colour);
                }
            
            }


            if (showAnimation){
                    //draw box border of side = radius

                    drawAnimationSq(animationX-workingRadius/2, animationY-workingRadius/2, workingRadius, WHITE, 0);
                
                
            }
                    
            

            // Colliding with food.
            if (headX == randX && headY == randY)
            {   
                showAnimation = true;
                animationX = headX;
                animationY = headY;
                //drawAnimationSquare(headX * SCALE, headY * SCALE, animationRadius, RED);
                // Generate new food position.
                randX = rand() % (RANDOM_RANGE + 1);
                randY = 1;
                fruitIdx = rand() % 5;

                // Increase snake length.
                snakeLength++;
                snake[snakeLength - 1].active = TRUE; // Set cell to active.
                snake[snakeLength - 1].colour = fruit_color[fruitIdx];

                // Update score.
                score = snakeLength - 1;

                // Display score on HEX displays and LEDs.
                *pLED = score;
                displayHex(score);
            }
            // Delay before clearing snake.
            int duration = DELAY;
            while (duration > 0)
            {
                duration--;
            }



            // Clear snake after delay.
            for (int i = 0; i < snakeLength; i++)
            {
                boxBuilder(snake[i].x, snake[i].y, SCALE, CLEAR,0,0);
            }

            if (showAnimation){
            drawAnimationSq(animationX-(workingRadius)/2, animationY-(workingRadius)/2, workingRadius, BLACK, 0);
            workingRadius = workingRadius + 10;
            if (workingRadius > 240){
                workingRadius = 0;
                showAnimation = false;
        }
        }
        

        
        //  clearAnimationSquare(headX * SCALE, headY * SCALE, animationRadius);

            // Draw current food.
            clearFruit(randX, randY+offsetEven, SCALE, CLEAR);
        
        
        
                offsetOdd = !offsetOdd;
                offsetEven = !offsetEven;
        
        }
    }

}

